import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { useState, useEffect } from "react";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Auth from "./components/Auth";
import Events from "./components/Events";
import Resources from "./components/Resources";
import About from "./components/About";
import Feedback from "./components/Feedback";
import Footer from "./components/Footer";
import DiscussionForum from "./components/DiscussionForum";
import Analytics from "./components/Analytics";
import Circular from "./components/Circular";
import ProtectedRoute from "./components/ProtectedRoute";
import { AUTHORIZED_ROLES } from "./config/roles";
import CreateEvent from './components/CreateEvent';
import CreateResource from './components/CreateResource';
import { AuthProvider } from './contexts/AuthContext';
import LandingPage from './components/LandingPage';

function App() {
  const [hasVisited, setHasVisited] = useState(false);

  useEffect(() => {
    const visited = localStorage.getItem('hasVisited');
    if (visited) {
      setHasVisited(true);
    }
  }, []);

  // Update hasVisited when localStorage changes
  useEffect(() => {
    const handleStorageChange = () => {
      const visited = localStorage.getItem('hasVisited');
      setHasVisited(!!visited);
    };

    window.addEventListener('storage', handleStorageChange);
    return () => window.removeEventListener('storage', handleStorageChange);
  }, []);

  const RequireVisited = ({ children }) => {
    return hasVisited ? children : <Navigate to="/" />;
  };

  return (
    <AuthProvider>
      <Router>
        {hasVisited && <Navbar />}
        <Routes>
          <Route path="/" element={!hasVisited ? <LandingPage /> : <Navigate to="/home" />} />
          <Route
            path="/home"
            element={
              <RequireVisited>
                <Home />
              </RequireVisited>
            }
          />
          <Route
            path="/auth"
            element={
              <RequireVisited>
                <Auth />
              </RequireVisited>
            }
          />
          <Route
            path="/about"
            element={
              <RequireVisited>
                <About />
              </RequireVisited>
            }
          />
          <Route
            path="/events"
            element={
              <RequireVisited>
                <Events />
              </RequireVisited>
            }
          />
          <Route
            path="/resources"
            element={
              <RequireVisited>
                <Resources />
              </RequireVisited>
            }
          />
          
          {/* Protected Routes - Only accessible by authorized roles */}
          <Route
            path="/forum"
            element={
              <RequireVisited>
                <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                  <DiscussionForum />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
          <Route
            path="/analytics"
            element={
              <RequireVisited>
                <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                  <Analytics />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
          <Route
            path="/feedback"
            element={
              <RequireVisited>
                <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                  <Feedback />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
          <Route
            path="/circular"
            element={
              <RequireVisited>
                <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                  <Circular />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
          <Route
            path="/events/create"
            element={
              <RequireVisited>
                <ProtectedRoute>
                  <CreateEvent />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
          <Route
            path="/events/edit/:id"
            element={
              <RequireVisited>
                <ProtectedRoute>
                  <CreateEvent />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
          <Route
            path="/resources/create"
            element={
              <RequireVisited>
                <ProtectedRoute>
                  <CreateResource />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
          <Route
            path="/resources/edit/:id"
            element={
              <RequireVisited>
                <ProtectedRoute>
                  <CreateResource />
                </ProtectedRoute>
              </RequireVisited>
            }
          />
        </Routes>
        {hasVisited && <Footer />}
      </Router>
    </AuthProvider>
  );
}

export default App;
